import Img2 from '../img/addNew/location-information-4-svgrepo-com.svg';
import Img3 from '../img/addNew/tasks-svgrepo-com.svg';



const AddNew = () => {
    return (
        <div className='AddNew'>
            <div className="addNew-wrapper">

                <div className="header-new">
                    {/* <div className="img-new active"><Img /></div>
                    <div className="img-new"><Img1 /></div>
                    <div className="img-new"><Img2 /></div>
                    <div className="img-new"><Img3 /></div> */}
                </div>
            </div>
        </div>
    );
};

export default AddNew;
